import React from "react";
import { Typography, makeStyles, Button } from "@material-ui/core";
import ArrowRightAltIcon from "@material-ui/icons/ArrowRightAlt";
import { Link } from "react-router-dom";
import Homemenuitem from "./Homemenuitem";
import menudata from "../../utils/menudata";

const useStyles = makeStyles((theme) => ({
  homemenu: {
    //padding: '50px 0px',
    paddingBottom: "50px",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    "@media (max-width: 500px)": {
      padding: "50px 0px",
    },
  },
  leaderBoard_left_h1: {
    lineHeight: "40px",
    fontFamily: "Inter, sans-serif",
    fontSize: "1.8rem",
    fontWeight: "bold",
    marginTop: "17px",
    textAlign: "center",
    marginBottom: "20px",
  },
  homemenu_menu: {
    fontFamily: "Inter, sans-serif",
    fontWeight: "bold",
    fontSize: "1rem",
  },
  homemenu_explore: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  homemenu_data: {
    display: "flex",
    justifyContent: "center",
    marginBottom: "30px",
    flexWrap: "wrap",
    paddingTop: "30px",
    "@media (max-width: 500px)": {
      paddingTop: "0px",
    },
  },
  button: {
    borderRadius: "20px",
    width: "150px",
    marginTop: "10px",
    textTransform: "lowercase",
    background: "white",
    border: "1px solid grey",
  },
}));

export default function Homemenu() {
  const {
    leaderBoard_left_h1,
    homemenu_menu,
    homemenu_explore,
    homemenu,
    button,
    homemenu_data,
  } = useStyles();
  return (
    <div className={homemenu}>
      <div className={homemenu_explore}>
        <Typography className={leaderBoard_left_h1} variant="h2" component="h1">
          Our best Services
        </Typography>
      </div>

      <div className={homemenu_data}>
        {menudata.map((data, index) => (
          <Homemenuitem key={index} {...data} />
        ))}
      </div>
      <Button
        disableElevation
        className={button}
        variant="contained"
        autoCapitalize="none"
        endIcon={<ArrowRightAltIcon />}
        component={Link}
        to={"/allmeals"}
      >
        see all food
      </Button>
    </div>
  );
}
